import React from "react";
import axios from "axios";

export const getTaxonomyfromAPI = () => {
  let response = "";
  axios
    .get(
      "http://localhost:8500/celerant360/server/coldfusion/taxonomy.cfc?method=getTaxonomy"
    )
    .then((response) => {
      console.log("response");
      console.log(response);
      return response;
    })
    .catch((error) => {});

  return response;
};
